jQuery(document).ready(function(){
	$('a.ShowCustomer').click(function(){
		var id = $(this).attr('for');
		var base_url = $(this).attr('data-base');
		$.ajax({
			url: base_url,
			type: 'get',
			dataType: 'json',
			data: {id: id},	
		success:function(html){
			$("#modal").html(html);
			//$("#modal").modal('show');
		}		
	});
	});


});
